import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';
import './Navbar.css';
function Navbar() {
  const [Menu,setMenu] = useState(true);
  return (
    <div className='navbar'>
      <div className="nav-logo">
        <img src={logo} alt="" />
      </div> 
      
      <ul className={Menu ? 'noMenu':'showMenu'}>
        <li><Link className='link' to="/">Shop</Link></li>
        <li><Link className='link' to="/cart">Cart</Link></li>
        <li><Link className='link' to="/login">Login</Link></li>
        <li><Link className='link' to="/dog">Dog</Link></li>
        <li><Link className='link' to="/cat">Cat</Link></li>
        <li><Link className='link' to="/bird">Bird</Link></li>
        <i className="ri-close-large-line exit" onClick={()=>{ {
          setMenu(truw)
        }}}></i>
      </ul>
      
      <div className='nav-login-cart'>
        <button>Login</button>
        <i className="ri-shopping-cart-line">
          <div className='dot'>5</div>
        </i>
        <i className="ri-menu-3-line Menu" onClick={()=>{setMenu((prev) => !prev)
        }}></i>
      </div>
    </div>
  );
}

export default Navbar;
